import React from 'react';
import axios from 'axios';

   

class UsersProduct extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      name: '',
      price:'', 
    };
  }
 
  handelChange(e) {
    this.setState({
      [e.target.name]: e.target.value,
    });
  }
  handelSubmite(e) {
    e.preventDefault();
    const { name, price } = this.state;
    axios
      .post(`http://localhost:4000/usersproduct`, {
        name, 
        price,
      })
      .then(response => {
        console.log(response)
        
      })
      .catch(error => {
        console.log('adding error', error);
      
      });
  }


  render() {
    return (
      <div className='inner-container'>
        <div class='h1'> 
          <h1>Dairy products Milk and cheese</h1>
        </div>
        <form onSubmit={this.handelSubmite.bind(this)} className='box'>
          <h1 className='header'>Add Product</h1>
          <hr class='hr' />
          <br />
          <div className='input-group'>
            <input
              type='text'
              name='name'
              value={this.state.name}
              onChange={this.handelChange.bind(this)}
              className='adding-input'
              placeholder='name'
            />
          </div>
          <br />

          <div className='input-group'>
            <input
              type='text'
              name='price'
              value={this.state.price}
              onChange={this.handelChange.bind(this)}
              className='adding-input'
              placeholder='price'
            />
          </div>
          <br />

          
          <br />
          <button class='btn'>Add product</button>
          <br />
         
        </form>
      </div>
    );
  }
}

export default UsersProduct;
